const About = () => (
    <div>
         <nav>
        <Link href="/about"><button>About</button></Link>
        <Link href="/"><button>Home Page</button></Link>
        </nav>
        <h1>About PAge</h1>
        <p>Need to figure props and state and routing</p>
    </div>
)

export default About;
